  ["taglike"] = "<html><body><h1>taglike</h1><p>taglike<p></p>adj.<p></p>tag1的变形<p></p>tag1<p></p>[tæɡ]<p></p>n.<p></p>[美国英语]标签；标志；(机动车)牌照<p></p>账单；价格标签<p></p>(破衣衫上)悬着的碎片<p></p>垂悬物；松散的末尾部<p></p>(鞋带等末端的)金属箍，金属包头<p></p>(衣服上的)挂襻；(鞋口跟部的)拉襻<p></p>【钓鱼】(系在钩柄假钓饵旁的)金属片，金属丝<p></p>断片；零碎的东西<p></p>口头禅；陈词滥调<p></p>称呼；绰号<p></p>[俚语](街头涂鸦者用漆喷在公共场所墙上等处的)艺术签名；留名 [1975]<p></p>【语言学】附加疑问套语<p></p>(戏剧、故事、演说等的)终场词，结束语；附加语<p></p>(在剧本或笑话中起画龙点睛作用的)结尾语<p></p>(为修辞目的或炫耀词藻而加的)简短引语(或警句)<p></p>一绺头发；一簇缠结的羊毛<p></p>(动物的)尾尖(尤指狐狸的白毛尾巴尖)<p></p>(花体字的)拖迹<p></p>[美国俚语]逮捕证<p></p>(掺入混合物中的)微量放射性同位素<p></p>【计算机】标记；标签<p></p>[废语]乌合之众；混乱的一堆<p></p>vt.<p></p>加标签于；给…附签条；装金属头于：<p></p>They have tagged all the items in the store.<p></p>他们已经给店里所有的商品贴了价签。<p></p>Don't forget to tag your suitcases with your name and address.<p></p>别忘了在你的衣箱上贴上写有你的姓名和住址的标签。<p></p>附加；添加：<p></p>She tagged a postscript to the end of the letter.<p></p>她在信尾加上了附言。<p></p>You should tag a moral to the story.<p></p>你应该赋予这则故事以寓意。<p></p>把…称为；给…起绰号：<p></p>They tagged him as a “playboy”.<p></p>他们管他叫“花花公子”。<p></p>指控…犯法：<p></p>The driver is tagged for speeding.<p></p>司机被指控超速驾车。<p></p>给(演说、故事等)加结束语，给…加上简短引语(或警句)：<p></p>to tag a speech with a poem<p></p>引用诗句结束演讲<p></p>给(诗句)押韵<p></p>[美国口语]给(违反停车规则的车)贴违章通知单，贴违章传票于：<p></p>His car was tagged by cops for obstructing traffic.<p></p>他的车因阻塞交通而被警察贴上了违章传票。<p></p>紧跟在…后面；尾随；跟踪：<p></p>She tags her boy friend around.<p></p>她尾随男朋友到各处。<p></p>[俚语](街头涂鸦者)在…上喷涂签名；喷涂留名于…[1975]<p></p>(用同位素等)标示，示踪：<p></p>tagged word<p></p>【计算机】标签字<p></p>to tag penicillin molecules<p></p>标记青霉素分子<p></p>给(羊)剪去缠结的毛<p></p>挑选；选择：<p></p>The goods would be tagged for military use.<p></p>这些货物要被选作军用品。<p></p>vi.<p></p>[口语]紧跟在后面，尾随，跟踪(常与along， after等连用)：<p></p>The boy tagged after his mother.<p></p>男孩紧跟在妈妈后面。<p></p>He tagged along with us.<p></p>他跟着我们走。<p></p>(涂鸦艺术家)作艺术签名，喷涂留名 [1995]<p></p>短语:<p></p>keep a tag on<p></p>[口语]监视；密切注意…的一举一动 [亦作 keep a tab on]<p></p>变形：<p></p>vt.<p></p>tagged<p></p>. tagging</p></body></html>",
