  ["than"] = "<html><body><h1>than</h1><p>conj. A particle expressing comparison, used after certain<p></p>   adjectives and adverbs which express comparison or diversity, as more,<p></p>   better, other, otherwise, and the like. It is usually followed by the<p></p>   object compared in the nominative case. Sometimes, however, the object<p></p>   compared is placed in the objective case, and than is then considered<p></p>   by some grammarians as a preposition. Sometimes the object is expressed<p></p>   in a sentence, usually introduced by that; as, I would rather suffer<p></p>   than that you should want.<p></p>adv. Then. See Then.</p><p>conj. 比, 除...外<p></p>prep. 比</p></body></html>",
