  ["thar"] = "<html><body><h1>thar</h1><p>n. A goatlike animal (Capra Jemlaica) native of the Himalayas.<p></p>   It has small, flattened horns, curved directly backward. The hair of<p></p>   the neck, shoulders, and chest of the male is very long, reaching to<p></p>   the knees. Called also serow, and imo.<p></p>v. impersonal, pres. It needs; need.</p><p>n. 塔尔（沙漠名, 位于南亚）</p></body></html>",
