  ["that"] = "<html><body><h1>that</h1><p>pron., a., conj., &  As a demonstrative pronoun (pl. Those),<p></p>   that usually points out, or refers to, a person or thing previously<p></p>   mentioned, or supposed to be understood. That, as a demonstrative, may<p></p>   precede the noun to which it refers; as, that which he has said is<p></p>   true; those in the basket are good apples.<p></p>pron., a., conj., &  As an adjective, that has the same<p></p>   demonstrative force as the pronoun, but is followed by a noun.<p></p>pron., a., conj., &  As a relative pronoun, that is<p></p>   equivalent to who or which, serving to point out, and make definite, a<p></p>   person or thing spoken of, or alluded to, before, and may be either<p></p>   singular or plural.<p></p>pron., a., conj., &  As a conjunction, that retains much of<p></p>   its force as a demonstrative pronoun.<p></p>pron., a., conj., &  To introduce a clause employed as the<p></p>   object of the preceding verb, or as the subject or predicate nominative<p></p>   of a verb.<p></p>pron., a., conj., &  To introduce, a reason or cause; --<p></p>   equivalent to for that, in that, for the reason that, because.<p></p>pron., a., conj., &  To introduce a purpose; -- usually<p></p>   followed by may, or might, and frequently preceded by so, in order, to<p></p>   the end, etc.<p></p>pron., a., conj., &  To introduce a consequence, result, or<p></p>   effect; -- usually preceded by so or such, sometimes by that.<p></p>pron., a., conj., &  In an elliptical sentence to introduce<p></p>   a dependent sentence expressing a wish, or a cause of surprise,<p></p>   indignation, or the like.<p></p>pron., a., conj., &  As adverb: To such a degree; so; as, he<p></p>   was that frightened he could say nothing.</p><p>a. 那, 那个<p></p>conj. 以致, 因为<p></p>pron. 那<p></p>adv. 那么, 那样</p></body></html>",
  ["thataway"] = "<html><body><h1>thataway</h1><p>adv. 朝那个方向, 按指示</p></body></html>",
  ["thatch"] = "<html><body><h1>thatch</h1><p>n. hair resembling thatched roofing material<p></p>n. plant stalks used as roofing material<p></p>n. a house roof made with a plant material (as straw)<p></p>v. cover with thatch</p><p>n. 盖屋顶的茅草, 用草盖的屋顶, 浓密头发<p></p>vt. 用茅草覆盖</p></body></html>",
