  ["tmesis"] = "<html><body><h1>tmesis</h1><p>n. The separation of the parts of a compound word by the<p></p>   intervention of one or more words; as, in what place soever, for<p></p>   whatsoever place.</p><p>n. [语]插词法</p></body></html>",
  ["to"] = "<html><body><h1>to</h1><p>prep. The preposition to primarily indicates approach and arrival,<p></p>   motion made in the direction of a place or thing and attaining it,<p></p>   access; and also, motion or tendency without arrival; movement toward;<p></p>   -- opposed to from.<p></p>prep. Hence, it indicates motion, course, or tendency toward a<p></p>   time, a state or condition, an aim, or anything capable of being<p></p>   regarded as a limit to a tendency, movement, or action; as, he is going<p></p>   to a trade; he is rising to wealth and honor.<p></p>prep. In a very general way, and with innumerable varieties of<p></p>   application, to connects transitive verbs with their remoter or<p></p>   indirect object, and adjectives, nouns, and neuter or passive verbs<p></p>   with a following noun which limits their action. Its sphere verges upon<p></p>   that of for, but it contains less the idea of design or appropriation;<p></p>   as, these remarks were addressed to a large audience; let us keep this<p></p>   seat to ourselves; a substance sweet to the taste; an event painful to<p></p>   the mind; duty to God and to our parents; a dislike to spirituous<p></p>   liquor.<p></p>prep. As sign of the infinitive, to had originally the use of last<p></p>   defined, governing the infinitive as a verbal noun, and connecting it<p></p>   as indirect object with a preceding verb or adjective; thus, ready to<p></p>   go, i.e., ready unto going; good to eat, i.e., good for eating; I do my<p></p>   utmost to lead my life pleasantly. But it has come to be the almost<p></p>   constant prefix to the infinitive, even in situations where it has no<p></p>   prepositional meaning, as where the infinitive is direct object or<p></p>   subject; thus, I love to learn, i.e., I love learning; to die for one's<p></p>   country is noble, i.e., the dying for one's country. Where the<p></p>   infinitive denotes the design or purpose, good usage formerly allowed<p></p>   the prefixing of for to the to; as, what went ye out for see? (Matt.<p></p>   xi. 8).<p></p>prep. In many phrases, and in connection with many other words, to<p></p>   has a pregnant meaning, or is used elliptically.<p></p>prep. Extent; limit; degree of comprehension; inclusion as far as;<p></p>   as, they met us to the number of three hundred.<p></p>prep. Effect; end; consequence; as, the prince was flattered to<p></p>   his ruin; he engaged in a war to his cost; violent factions exist to<p></p>   the prejudice of the state.<p></p>prep. Apposition; connection; antithesis; opposition; as, they<p></p>   engaged hand to hand.<p></p>prep. Accord; adaptation; as, an occupation to his taste; she has<p></p>   a husband to her mind.<p></p>prep. Comparison; as, three is to nine as nine is to twenty-seven;<p></p>   it is ten to one that you will offend him.<p></p>prep. Addition; union; accumulation.<p></p>prep. Accompaniment; as, she sang to his guitar; they danced to<p></p>   the music of a piano.<p></p>prep. Character; condition of being; purpose subserved or office<p></p>   filled.</p><p>prep. 到, 向, 趋于<p></p>adv. 向前</p></body></html>",
