  ["tramping"] = "<html><body><h1>tramping</h1><p>v travel on foot, especially on a walking expedition<p></p>v walk heavily and firmly, as when weary, or through mud<p></p>v cross on foot<p></p>v move about aimlessly or without any destination, often in search of food or employment</p><p>[机] 踩紧</p></body></html>",
  ["trampish"] = "<html><body><h1>trampish</h1><p>trampish<p></p>adj.<p></p>tramp的变形<p></p>tramp<p></p>[træmp]<p></p>vi.<p></p>以沉重的步伐走：<p></p>He tramped up and down in the office.<p></p>他在办公室里沉重地走来走去。<p></p>The soldiers were tramping by.<p></p>士兵们踏着沉重的步伐走过。<p></p>重力踩；践踏(常与 on 或 upon连用)：<p></p>to tramp on someone's toes<p></p>踩了某人的脚<p></p>They tramped on the flowers.<p></p>他们踩在了花上。<p></p>步行；徒步旅行；远征：<p></p>They tramped over the moors.<p></p>他们徒步走过荒野。<p></p>流浪；漂泊：<p></p>The beggars tramped about the streets.<p></p>乞丐们在街头流浪。<p></p>乘不定期货轮旅行<p></p>vt.<p></p>踩；践踏：<p></p>to tramp grapes in order to make wine<p></p>用脚踩葡萄以便酿葡萄酒<p></p>走过；跋涉于…：<p></p>to tramp the street<p></p>在街上行走<p></p>He planned to tramp the whole country.<p></p>他计划徒步走遍全国。<p></p>n.<p></p>步行；徒步旅行<p></p>徒步旅行者<p></p>脚步声；重步声<p></p>游民；流浪者；乞丐<p></p>[俚语](与男子混在一起的)轻浮女人<p></p>[美国俚语]妓女；荡妇<p></p>【航海学】不定期货船；不定航线货船[参较cargo liner]<p></p>鞋底底铁；防滑鞋钉<p></p>adj.<p></p>流动的；无固定住处的；流浪的<p></p>近义词:<p></p>vagrant<p></p>短语:<p></p>on the tramp<p></p>走江湖，跑码头；漂泊着<p></p>tramp it<p></p>行走，步行</p></body></html>",
  ["trample"] = "<html><body><h1>trample</h1><p>n. the sound of heavy treading or stomping<p></p>v. injure by trampling or as if by trampling</p><p>n. 践踏(声), 蹂躏<p></p>v. 践踏, 无视</p></body></html>",
